INSERT INTO `v1_7448be95bcf40d2fe553a5b025fd87bc95aa9f0f084c6fb7795c9cca2c0635e1` VALUES (1, 72, 10, 0, 1, "そしたらアオイさん、\n顔を真っ赤にして、ブンブン！　って、\n首を縦に振ってくれて。\nやった！　って思ったんですよね。", 0, 11, 0, 72025, 1);
